import styled from "styled-components";

export const StyledMain = styled.main`
    display: flex;
    flex-direction: column;
    width: 85%;

    span {
      color: var(--color-white);
      font-size: var(--headline-1);
      font-weight: var(--font-weight-3);
      line-height: 25px;
      text-align: justify;
    }
`
